"use strict";

const AdminModule = lacoLib('./libs/admin_module');

class Dashboard extends AdminModule {
    constructor() {
        super(__dirname, 'Dashboard');
        super.registerViews([
            'main',
            'setting'
        ]);
    }

    main(req, res) {
        this.view('main', {}, req, res);
    }
}
module.exports = Dashboard;
